import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import "../admin/admin.css"
export default function Adminnav(){
    return(
        <>
            <div className="container-fluid" style={{padding:"0"}}>
                        <div className="row a-style" style={{margin:"0"}}>
                            

                                <div className="sidebar content bg-gradient">
                                <Link to =""className="text">จัดการข้อมูลผู้ใช้</Link><br></br>
                                <Link to className="text">ประเภทสินค้า</Link><br></br>
                                <a className="navbar-brand a-style" href="#">nav3</a>
                                </div>
                           
                            
                        </div>
            </div>
        </>
    )
}
